function TeamsPage() {
    return (
      <main className="page-container">
        <h1 className="page-title">Équipes</h1>
        <p className="page-description">Découvrez toutes les équipes de la ligue et leurs joueurs.</p>
        <div className="page-content">
          <p>Page des équipes en construction...</p>
        </div>
      </main>
    )
  }
  
  export default TeamsPage
